const MentoringType = (props) => {
  const { mentoringType } = useContext(ProfileContext);
  return (
    <div>
      <h2 className="mentoringTypeTitle">Mentorat propos√© par Vincent</h2>
      <div className="typeOfMentoringContainer">
        <SoloMentoringGray />
        <GroupMentoring />
